"use strict";

// import * as tf from '@tensorflow/tfjs';
import * as tfconv from '@tensorflow/tfjs-converter';
import * as tfcore from '@tensorflow/tfjs-core';
// import '@tensorflow/tfjs-backend-webgl';
import '@tensorflow/tfjs-backend-cpu';
// let classes = ["NOT doge", "doge", "dogecoin"]
let classes = ["NOT doge", "doge"]

window.onload = async function () {

    let alreadyPreheated = false
    const model = await tfconv.loadGraphModel('https://dogeclassifier.com/tjfs2/model.json', {
        
        onProgress: (fraction) => {
            let event = new CustomEvent("loadTfModelProgress", {"detail": fraction})

            setTimeout(function(){
                document.dispatchEvent(event)
            },0);
        }
    });
    // preheatModel().then(() => alreadyPreheated = true)

    document.addEventListener("canvasImageDrawn", async (event) => {
        // console.log("canvasImageDrawn")

        let canvasElement = event.detail
        document.dispatchEvent(new CustomEvent("searchingClassOfImage"))
        predictImage(canvasElement.getImageData(0, 0, 224, 224)).then((result) => {
            // console.log('result: ', result)
            let indexOfFoundClass = tfcore.argMax(result).dataSync()[0]
            let imageClass = classes[indexOfFoundClass]
            let event = null
            if (imageClass === "NOT doge") {
                event = new CustomEvent("foundClassOfImage", {detail: "NOT doge"})
            } else if (imageClass === "doge") {
                event = new CustomEvent("foundClassOfImage", {detail: "doge"})
            }

            document.dispatchEvent(event)
        })
    });

    async function preheatModel() {
        const dogeImageToPredictToPreheatModel = "data:image/png;base64,"
        let image = new Image()
        image.addEventListener("load", async (event) => {

            predictImage(image).then((result) => {
                console.log('preheat result: ', result)
            })
        })
        image.src = dogeImageToPredictToPreheatModel

        return Promise.resolve()
    }

    async function predictImage(image) {
        let fromUploadTensor = tfcore.browser.fromPixels(image)
        fromUploadTensor = tfcore.expandDims(fromUploadTensor, 0)
        let prediction = model.predict(fromUploadTensor.toFloat())
        return prediction.arraySync()[0]
    }
}
